import React from 'react';
import Grid from '@material-ui/core/Grid';
import styles from '../../css/Home.module.css';

export const Showcase = () => {
    return(
        <React.Fragment>
            <Grid container>
                <Grid item xs={5} style={{height:"30%"}}>
                    <div className={styles.showcaseBox1}>1</div>
                </Grid>
                <Grid item xs={7} style={{paddingLeft:"1%"}}>
                    <div className={styles.showcaseBox2}>2</div>
                </Grid>     
            </Grid>
        </React.Fragment>
    )
}
